    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Crocodile Lake NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Crocodile Lake NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, and information about
    the management direction and plan implementation. Key planning issues include: wildlife
    and habitat conservation, land protection and conservation, education and visitor
    services, and Refuge administration.",nt"license_title": "License Not Specified",nt"extras":
